import React, { useEffect, useState, useContext } from "react";
import SearchAndCategory from './searchAndCategory.js'
import HomeDiv from './homeDiv.js'
import Button from '@material-ui/core/Button';
import './home.css'
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import carPhoto from './imgs/carPhoto.jpg'

export default function Home() {
    const [items, setItems] = useState([
        {
            brand: "Audi",
            model: "A5",
            price: 25000,
            year: 2011
        },
        {
            brand: "Mercedes",
            model: "E250",
            price: 30000,
            year: 2015
        },
        {
            brand: "BMW",
            model: "530d",
            price: 35000,
            year: 2014
        }, {
            brand: "Skoda",
            model: "Superb",
            price: 16000,
            year: 2013
        },
        {
            brand: "Mitsubishi",
            model: "Galant",
            price: 5000,
            year: 2001
        },
        {
            brand: "Cadillac",
            model: "Escalade",
            price: 70000,
            year: 2014
        },
        {
            brand: "Lexus",
            model: "LFA",
            price: 300000,
            year: 2017
        }
    ]);
    return (
        <>
            <SearchAndCategory />
            <HomeDiv />
            <div id='addNewSection'>
                <h2>Recently Added Cars</h2>
                <Button variant="contained" color="secondary" id='sellButton'>
                    Sell a Car
                </Button>
            </div>
            <div id='itemsSection'>
                {items.map((row, index) => (
                    <Card className='card' raised={true} key={index}>
                        <div className="imageContainer">
                            <img src={carPhoto} alt='bookImage' className='carImg'/>
                        </div>
                        <div className="contentContainer">
                            <h3>{row.brand} {row.model}</h3>
                            <p></p>
                            <p>{row.price}</p>
                            <p>{row.year}</p>
                        </div>
                    </Card>
                ))}

            </div>
        </>
    )
}
